import {Container,Nav,Navbar,Row,Col,Form} from 'react-bootstrap';
import './App.css';
import { useState } from 'react';
import data from './data.js';
import { Routes,Route,Link,Outlet, useNavigate } from 'react-router-dom';
import Detail from './routes/detail.js'
import About from './routes/about.js'
import Itemlist from './routes/itemlist.js'
import Home from './routes/home.js'
import { FaUser,FaHeart,FaShoppingBag } from "react-icons/fa";

function App() {


  let [shoes]=useState(data);
  let [navmodal,setNavmodal]=useState(false);
  let navigate=useNavigate();
  let [isHovering,setIsHovering]=useState(false);

  const handleMouseOver = () => {
    setIsHovering(true);
  };

  const handleMouseOut = () => {
    setIsHovering(false);
  };
  return (   

    <div className="App">

<Navbar className="Header" expand="sm" fixed="top" bg="dark" data-bs-theme="dark">
        <Container >
          <Navbar.Brand href="/">Navbar</Navbar.Brand>
          <Nav className="me-auto">

            <Nav.Link onMouseOver={handleMouseOver} onMouseOut={handleMouseOut} href="itemlist">Men</Nav.Link>
            <Nav.Link onMouseOver={handleMouseOver} onMouseOut={handleMouseOut} href="itemlist">Women</Nav.Link>
            <Nav.Link onClick={()=>{navigate(-1)}}>뒤로가기</Nav.Link>
          </Nav>
          <Row>
          <Col><Form>            
            <Form.Control
              type="search"
              placeholder="Search"
              className="me-2"
              aria-label="Search"/>        
          </Form></Col>             
        </Row>
          <button><FaUser/></button>
          <button><FaHeart/></button>
          <button><FaShoppingBag/></button>
        </Container>        
      </Navbar>
      {isHovering==true?<MenuM/>:null}
      <Routes>
        <Route path="/" element={<Home/>}/>
        <Route path ="/itemlist" element={<Itemlist/>}/>
        <Route path="/detail/:id" element={<Detail shoes={shoes}/>}>
        </Route>
        <Route path="/about" element={<About/>}>
          <Route  path="member" element={<Member/>}/> 
          <Route path="location" element={<Location/>}></Route>
        </Route>
        <Route path="*" element={<div>404없는페이지</div>}/>
      </Routes> 

      </div>    
  );
}

function MenuM(){
  return(
<div className='Body'>
  <p>남자옷</p>
  <p>상의임</p>
  <p>하의임</p>
  </div>
  )
}
function MenuW(){
  return(
<div className='Body'>
  <p>여자옷</p>
  <p>상의임</p>
  <p>하의임</p>
  </div>
  )
}

function Member(){
  return(
    <div>member페이지임</div>
  )
}
function Location(){
  return(
    <div>location페이지임</div>
  )
}
export default App;
